🏆В Самаре наградили победителей и призеров областного конкурса профессионального мастерства «Классный руководитель года». Среди награжденных 3 педагога из Тольятти❗

В этом году в конкурсе приняли участие 62 педагога из 49 профессиональных образовательных организаций Самарской области. 

Лучшими из них по мнению членов жюри стали: 

В номинации «Профессиональное воспитание» 
🥇Ермилова Милана Фёдоровна (Тольяттинский медицинский колледж) – 1 место; 
🥈Пужайкина Ирина Владимировна (Красноярский государственный техникум) – 2 место; 
🥉Данько Ольга Алексеева (Тольяттинский социально-педагогический колледж) – 3 место. 

В номинации «Профилактическая работа» 
🥇Андрюхина Елена Викторовна (Сергиевский губернский техникум) – 1 место; 
🥈Петрова Анастасия Сергеевна (Безенчукский аграрный техникум) – 2 место; 
🥉Селиваткин Николай Сергеевич (Тольяттинский электротехнический техникум) – 3 место. 

🎊Поздравляем победителей и желаем дальнейших успехов!
